 {'marketingLongName': '<span style="color: rgb(71, 71, 71); font-family: &quot;Google Sans&quot;, Roboto, Arial, sans-serif; font-size: 16px; background-color: rgb(255, 255, 255);">The most common threat to vehicles happens whenever someone opens a car door. Tight spaces, careless kids, and concrete walls can chip paint and ding edges. Mobile Clear Shield\'s door edge guards&nbsp;</span><span style="background-color: rgb(211, 227, 253); color: rgb(4, 12, 40); font-family: &quot;Google Sans&quot;, Roboto, Arial, sans-serif; font-size: 16px;">save you from dings and dents with tough, durable, invisible 14-mil protection,</span>', 'marketingName': 'CLEARSHIELD PROTECTIVE FILM ', 'optionCd': 'PT300', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<h2 class="customerCopyHeader heading-05" style="box-sizing: border-box; font-family: pcoMed, HelveticaNeueMedium, &quot;Helvetica Neue Medium&quot;, Arial, sans-serif; font-size: 16px; letter-spacing: -0.5px; line-height: 24px; color: rgb(0, 0, 0);">The Importance of Utilizing Toyota Wheel Locks Genuine Parts</h2><div class="customerCopyComments" style="box-sizing: border-box; font-family: pcoLight, HelvNeueLight, &quot;Helvetica Neue Light&quot;, Arial, sans-serif; font-size: 14px; color: rgb(0, 0, 0);">Constructed of forged, hardened steel with triple-nickel or zinc plating, Toyota wheel locks provide inexpensive, dependable protection against wheel and tire theft—along with peace-of-mind in knowing wheels and tires are secure. Wheel locks can save vehicle owners the time and expense of replacing their wheels and tires, while also helping protect against additional vehicle damage that can occur during theft. Not to mention protection from being stranded away from home or having to pay out-of-pocket insurance deductibles. Wheel locks are available in kits of four or five (the 5th lock is for exterior mounted spares).</div>', 'marketingName': 'Toyota Wheels Lock', 'optionCd': 'PT800', 'optionType': 'D', 'packageInd': False}]

