 {'marketingLongName': '<span style="color: rgb(77, 77, 79); font-family: LLumar_FaktPro-Blond; font-size: 18px; background-color: rgb(255, 255, 255);">LLumar® dyed window tint is made with integrated, color-stable dye so the deep charcoal hue stays true. Other tint has dye applied only to the surface, making it less durable and likely to discolor.&nbsp;&nbsp;</span>', 'marketingName': 'LLumar Window Tint', 'optionCd': 'TINT', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<ul class="body-ul" style="box-sizing: border-box; list-style-position: inside; margin-left: 47.6px; padding-left: 2.2rem; color: rgb(0, 0, 0); font-family: Charter, Georgia, Times, serif; font-size: 19px;"><li style="box-sizing: border-box; list-style: outside none; margin-bottom: 0.625rem; font-family: &quot;Zilla Slab&quot;, serif; font-size: 1.125rem; color: rgb(36, 36, 36); line-height: 1.6;"><span style="box-sizing: border-box; font-weight: 700;">Gas Mileage.</span>&nbsp;Properly inflated tires can improve gas mileage, whether they are filled with air or nitrogen. You can use nitrogen in your tires to possibly help your tires stay correctly inflated longer.</li><li style="box-sizing: border-box; list-style: outside none; margin-bottom: 0.625rem; font-family: &quot;Zilla Slab&quot;, serif; font-size: 1.125rem; color: rgb(36, 36, 36); line-height: 1.6;"><span style="box-sizing: border-box; font-weight: 700;">Tire Longevity.</span>&nbsp;Maintaining proper tire pressure can help your tires last longer. You can accomplish this with nitrogen or air, although nitrogen may require fewer top-offs.</li><li style="box-sizing: border-box; list-style: outside none; margin-bottom: 0.625rem; font-family: &quot;Zilla Slab&quot;, serif; font-size: 1.125rem; color: rgb(36, 36, 36); line-height: 1.6;"><span style="box-sizing: border-box; font-weight: 700;">Better Handling.</span>&nbsp;Vehicles handle better when tires are kept at the right capacity. Using nitrogen might help you keep your tires at the proper volume longer.</li></ul>', 'marketingName': 'Nitrogen Filled Tire', 'optionCd': 'NIT', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<span style="box-sizing: inherit; font-size: 20px;">Everybody wants their car to look as good as new. That\'s the beauty of Appearance Protection, keeping your vehicle looking great inside and out by applying products directly to the vehicle\'s exterior and interior surfaces to protect and maintain the quality and appearance of the vehicle.</span><br style="box-sizing: inherit;"><div style="box-sizing: inherit; font-size: 20px;"><span style="box-sizing: inherit; font-size: 20px;"><br style="box-sizing: inherit;"></span></div><div style="box-sizing: inherit; font-size: 20px;"><span style="box-sizing: inherit; font-size: 20px;">With this protection, spills, splatters and everyday mishaps can be more easily removed before they become permanent stains on the vehicle\'s interior and, advanced sunscreens and penetrating conditioners will maintain your leather, and the vehicles exterior paint will maintain its "new" car shine.</span><span style="box-sizing: inherit; font-size: 20px;"><br style="box-sizing: inherit;"></span></div><div style="box-sizing: inherit; font-size: 20px;"><span style="box-sizing: inherit; font-size: 20px;"><br style="box-sizing: inherit;"></span></div><div style="box-sizing: inherit; font-size: 20px;"><ul style="box-sizing: inherit; padding-top: 15px; padding-left: 20px; font-size: 0.875rem; background-color: rgb(255, 255, 255); font-family: ToyotaType-Book; line-height: 1.5rem; color: rgb(0, 0, 0);"><li style="box-sizing: inherit; padding-top: 4px; padding-bottom: 4px; font-size: 14px;">Paint Protection protects your vehicle from the effects of acid rain, spotting, fading, oxidation, and loss of gloss.</li><li style="box-sizing: inherit; padding-top: 4px; padding-bottom: 4px; font-size: 14px;">Fabric Protection protects the interior fabric by preventing stains and discoloration allowing for quick and easy clean up.</li><li style="box-sizing: inherit; padding-top: 4px; padding-bottom: 4px; font-size: 14px;">Leather Protection inhibits UV damage, drying and the loss of soft, supple texture, fading, discoloration, staining, premature aging and cracking, rips, tears and burns.</li></ul></div>', 'marketingName': 'Appearance Package', 'optionCd': 'APPKG', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<p style="margin-bottom: 16px; color: rgba(0, 0, 0, 0.9); font-family: &quot;DDC Heading Font Face&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);">Sometimes a little dent in your car can leave a big dent in your wallet. That\'s why Dent Protection covers your vehicle from those unavoidable dents. Using an innovative process, skilled technicians manipulate the metal to remove common dents and restore the vehicle back to its original condition.<br></p><p style="margin-bottom: 16px; color: rgba(0, 0, 0, 0.9); font-family: &quot;DDC Heading Font Face&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245);"><span style="font-weight: 700;">Key Features</span></p><ul list-style:="" outside="" none="" disc;="" padding-left:="" 30px;""="" style="margin-bottom: 16px; color: rgba(0, 0, 0, 0.9); font-family: &quot;DDC Heading Font Face&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif; font-size: 14px; background-color: rgb(245, 245, 245); list-style-position: outside; list-style-image: none; padding-left: 30px;"><li>Repairs dents up to 4 inches on metal panels where the painting has not been broken.</li><li>Lifetime repair guarantee that the dent will not reappear.</li><li>Repairs are completed by certified technicians.</li><li>Zero deductible.</li><li>Hail damage benefit up to $1,000.</li><li>Nationwide coverage.</li></ul>', 'marketingName': 'Dent Protection Package', 'optionCd': 'DPPKG', 'optionType': 'D', 'packageInd': False}]

