 {'marketingLongName': '<span style="background-color: white; color: rgb(64, 64, 64); font-family: Arial, sans-serif; font-size: 13pt;">Premium polyurethane paint\nprotection film is clear, so the original paint color and luster shine through. Door Edge &amp; Cup Guards .</span><p class="MsoNormal"><span style="font-size: 13pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-color: white;"><o:p></o:p></span></p>', 'marketingName': 'Door Edge & Cup Guards', 'optionCd': 'PTM', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<p class="MsoNormal"><span style="font-size: 13pt; line-height: 107%; font-family: Arial, sans-serif; color: rgb(64, 64, 64); background-color: white;">Premium polyurethane paint\nprotection film is clear, so the original paint color and luster shine through. With CHIPROTECT, this durable film provides guaranteed protection against rock chips on vulnerable areas of vehicles, keeping the factory paint finish intact. A 10-year warranty against any material defects such as discoloring, cracking or peeling.&nbsp;<o:p></o:p></span></p>', 'marketingName': 'Chiprotect 10yrs Coverage', 'optionCd': 'COP', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<p class="font7" style="margin: 0in 0in 0.0001pt; line-height: 18pt;"><span style="color: black; font-family: Arial, sans-serif; font-size: 13pt;">Windshield Protection smooths the properties of the glass to\nminimize the effects of propelled road debris and provides maximum protection\nto your vehicle’s treated windshield. Coverage </span><span style="color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 17.3333px;">includes</span><span style="color: black; font-family: Arial, sans-serif; font-size: 13pt;">&nbsp;Repair or\nreplacement of the windshield for chips or cracks caused by small rocks, stones\nor other road debris.&nbsp;Replacement with original equipment manufacturer or\nlike-kind and quality glass.&nbsp;As many repairs/replacements up to your\ncontract aggregate limit.<o:p></o:p></span></p>', 'marketingName': 'PermaPlate Windshield Protection 5yrs Coverage', 'optionCd': 'PPWIND', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': 'Appearance Protection provides maximum defenses for your vehicle’s exterior and interior treated surfaces by \nutilizing the latest technology advancements in surface protection products. Coupled with superior warranty \ncoverage, PermaPlate’s Appearance Protection Program has led the industry since 1978.&nbsp;', 'marketingName': 'PermaPlate Appearance Protection 5yrs Coverage', 'optionCd': 'PA101', 'optionType': 'D', 'packageInd': False}
 {'marketingLongName': '<span style="color: rgb(64, 64, 64); font-family: Arial, sans-serif; font-size: 17.3333px; background-color: rgb(255, 255, 255);">Pulse is the rear-end collision deterrent that rapidly pulses your third brake light 4 times when you press the brake pedal (the pulsing does not repeat upon any subsequent application of the brakes for 5 seconds so as not to annoy trailing drivers in stop-and-go traffic).</span>', 'marketingName': 'Pulse', 'optionCd': 'P01', 'optionType': 'D', 'packageInd': False}
