 {'marketingLongName': '<h1 class="entry-title" style="overflow-wrap: break-word; margin-top: 20px; margin-bottom: 10px; font-family: Nobel, sans-serif; line-height: 1.1; color: rgb(51, 51, 51); font-size: 30px; text-transform: uppercase; background-color: rgb(255, 255, 255);">WHAT IS THE PULSE<span style="font-size: 22.5px; line-height: 0; position: relative; top: -0.5em;">®</span>&nbsp;SAFEty BRAKING TECHNOLOGY?</h1><div class="entry" style="color: rgb(51, 51, 51); font-family: Nobel, serif; font-size: 13px; background-color: rgb(255, 255, 255);"><ul style="overflow-wrap: break-word; margin-bottom: 10px;"><li>PULSE<span style="font-size: 9.75px; line-height: 0; position: relative; top: -0.5em;">®</span>&nbsp;is a rear-end collision avoidance system.</li><li>When the brake pedal is pressed, PULSE<span style="font-size: 9.75px; line-height: 0; position: relative; top: -0.5em;">®</span>&nbsp;causes the third brake light to rapidly pulse 4 times.</li><li>PULSE<span style="font-size: 9.75px; line-height: 0; position: relative; top: -0.5em;">®</span>&nbsp;creates an attention-getting alert for the driver behind you, warning them that you’re slowing down or stopping.</li><li>PULSE<span style="font-size: 9.75px; line-height: 0; position: relative; top: -0.5em;">®</span>&nbsp;is revolutionary, DOT certified and award-winning.</li></ul></div>', 'marketingName': 'Pulse Safety System', 'optionCd': 'MPK-BLKSTD-20', 'optionType': 'D', 'packageInd': False}]

